function [fitresult, gof] = createFit_log(dilution_log, cov_log, T)
%CREATEFIT(DILUTION_LOG,COV_LOG,T)
%  Create a fit.
%
%  Data for 'log polynomial fit' fit:
%      X Input : dilution_log
%      Y Input : cov_log
%      Z Output: T
%  Output:
%      fitresult : a fit object representing the fit.
%      gof : structure with goodness-of fit info.
%
%  See also FIT, CFIT, SFIT.

%  Auto-generated by MATLAB on 06-Oct-2013 20:04:13


%% Fit: 'log polynomial fit'.
[xData, yData, zData] = prepareSurfaceData( dilution_log, cov_log, T );

% Set up fittype and options.
ft = fittype( 'poly22' );
opts = fitoptions( ft );
opts.Lower = [-Inf -Inf -Inf -Inf -Inf -Inf];
opts.Upper = [Inf Inf Inf Inf Inf Inf];

% Fit model to data.
[fitresult, gof] = fit( [xData, yData], zData, ft, opts );

% Plot fit with data.
f = figure( 'Name', 'log polynomial fit' );
h = plot( fitresult, [xData, yData], zData );
legend( h, 'log polynomial fit', 'T vs. log10(dilution), log10(cov)', 'Location', 'NorthEast' );
% Label axes
xlabel( 'log10(dilution)' );
ylabel( 'log10(cov)' );
zlabel( 'T' );
grid on
view( 19, 14);
saveas(gcf,'surfacefit_log','fig')
close(gcf)

